const Accordion={settings:{},init:function(a){const b=a.getElementsByClassName("accordion"),c=a.getElementsByClassName("accordion-body");for(var d=0;d<b.length;d++){const e=b[d],f=e.getElementsByClassName("accordion-head")[0],g=e.getElementsByClassName("accordion-body")[0];f.addEventListener("click",function(a){for(var b=0;b<c.length;b++)c[b].style.display="none";g.style.display="block"})}}};!function(){const a=document.getElementsByClassName("accordions");for(var b=0;b<a.length;b++)Accordion.init(a[b])}();